import React, { useState, useEffect } from "react";
import "./App.css";
import { Container, Button } from "reactstrap";

const App = () => {
  const [algo, setAlgo] = useState(true);
  const toggle = () => {
    setAlgo(!algo);
  };
  useEffect(() => {
    console.log(algo);
  }, [algo]);

  return (
    <Container>
      <Button color="succes" onClick={() => toggle()}>
        {algo ? "Wenas" : "adios" ? "2" : "3"}
      </Button>
      <p>Wenas</p>
    </Container>
  );
};

export default App;
